import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { FooterContainer, RightOptions } from './footer.styles';

const Footer = () => {
    const { mediaPref } = useSelector(state => state.userReducer);
    const MediaIcon = () => {
        switch (mediaPref) {
            case 'Youtube':
                return (
                    <YoutubeFilled />
                )
            default:
                return (
                    <YoutubeFilled />
                )
        }
    }
    return (
        <FooterContainer>
            <RightOptions>
                <MediaIcon />
            </RightOptions>
        </FooterContainer>
    )
}

export default Footer;
